shadow.field:
// - Global variables -
var DISABLE_DEACTIVATION = 4;
var ZERO_QUATERNION = new v3d.Quaternion(0, 0, 0, 1);

var physicsWorld = v3d.puzzles.physics.world;

// used to control vehicle
if (app.controls)
    app.controls.enableKeys = false;

// Wheels
var FRONT_LEFT = 0;
var FRONT_RIGHT = 1;
var BACK_LEFT = 2;
var BACK_RIGHT = 3;

// Graphics variables
var materialInteractive = new v3d.MeshPhongMaterial( { color:0x990000 } );

function getWheelMesh(index) {
    switch (index) {
        case FRONT_LEFT:
            return app.scene.getObjectByName('wheel_front_left');
        case FRONT_RIGHT:
            return app.scene.getObjectByName('wheel_front_right');
        case BACK_LEFT:
            return app.scene.getObjectByName('wheel_rear_left');
        case BACK_RIGHT:
            return app.scene.getObjectByName('wheel_rear_right');
    }
}

function createVehicle(pos, quat) {

    // Vehicle contants

    var chassisWidth = 1.0;
    var chassisHeight = 0.4;
    var chassisLength = 3.6;
    var massVehicle = 800;

    var wheelAxisPositionFront = 1.15;
    var wheelRadiusFront = 0.3;
    var wheelWidthFront = 0.2;
    var wheelHalfTrackFront = 0.65;
    var wheelAxisHeightFront = 0.25;

    var wheelAxisPositionBack = -1.05;
    var wheelRadiusBack = 0.3;
    var wheelWidthBack = 0.2;
    var wheelHalfTrackBack = 0.65;
    var wheelAxisHeightBack = 0.25;

    var friction = 1000;
    var suspensionStiffness = 30.0;
    var suspensionDamping = 2.3;
    var suspensionCompression = 2;
    var suspensionRestLength = 0.6;
    var rollInfluence = 0.01;

    // Chassis
    var geometry = new Ammo.btBoxShape(new Ammo.btVector3(chassisWidth * 0.5, chassisHeight * 0.5, chassisLength * 0.5));
    var transform = new Ammo.btTransform();
    transform.setIdentity();
    transform.setOrigin(new Ammo.btVector3(pos.x, pos.y, pos.z));
    transform.setRotation(new Ammo.btQuaternion(quat.x, quat.y, quat.z, quat.w));
    var motionState = new Ammo.btDefaultMotionState(transform);
    var localInertia = new Ammo.btVector3(0, 0, 0);
    geometry.calculateLocalInertia(massVehicle, localInertia);
    var body = new Ammo.btRigidBody(new Ammo.btRigidBodyConstructionInfo(massVehicle, motionState, geometry, localInertia));
    body.setActivationState(DISABLE_DEACTIVATION);
    physicsWorld.addRigidBody(body);
    body.setDamping(0.2, 0.0);
    var chassisMesh = app.scene.getObjectByName('car_body');

    v3d.puzzles.physics.addToSyncList(chassisMesh, body, 'DYNAMIC');

    // Raycast Vehicle
    var engineForce = 0;
    var vehicleSteering = 0;
    var breakingForce = 0;
    var tuning = new Ammo.btVehicleTuning();
    var rayCaster = new Ammo.btDefaultVehicleRaycaster(physicsWorld);
    var vehicle = new Ammo.btRaycastVehicle(tuning, body, rayCaster);
    vehicle.setCoordinateSystem(0, 1, 2);
    physicsWorld.addAction(vehicle);

    var wheelMeshes = [];
    var wheelDirectionCS0 = new Ammo.btVector3(0, -1, 0);

    function addWheel(isFront, pos, radius, width, index) {
        var wheelAxleCS = new Ammo.btVector3(-1, 0, 0);

        var wheelInfo = vehicle.addWheel(
                pos,
                wheelDirectionCS0,
                wheelAxleCS,
                suspensionRestLength,
                radius,
                tuning,
                isFront);

        wheelInfo.set_m_suspensionStiffness(suspensionStiffness);
        wheelInfo.set_m_wheelsDampingRelaxation(suspensionDamping);
        wheelInfo.set_m_wheelsDampingCompression(suspensionCompression);
        wheelInfo.set_m_frictionSlip(friction);
        wheelInfo.set_m_rollInfluence(rollInfluence);

        wheelMeshes[index] = getWheelMesh(index);
    }

    addWheel(true, new Ammo.btVector3(wheelHalfTrackFront, wheelAxisHeightFront, wheelAxisPositionFront), wheelRadiusFront, wheelWidthFront, FRONT_LEFT);
    addWheel(true, new Ammo.btVector3(-wheelHalfTrackFront, wheelAxisHeightFront, wheelAxisPositionFront), wheelRadiusFront, wheelWidthFront, FRONT_RIGHT);
    addWheel(false, new Ammo.btVector3(wheelHalfTrackBack, wheelAxisHeightBack, wheelAxisPositionBack), wheelRadiusBack, wheelWidthBack, BACK_LEFT);
    addWheel(false, new Ammo.btVector3(-wheelHalfTrackBack, wheelAxisHeightBack, wheelAxisPositionBack), wheelRadiusBack, wheelWidthBack, BACK_RIGHT);

    // Sync keybord actions and physics and graphics
    function sync() {

        var speed = vehicle.getCurrentSpeedKmHour();

        breakingForce = 0;
        engineForce = 0;

        if (VARS.actions.acceleration) {
            if (speed < -1)
                breakingForce = VARS.maxBreakingForce;
            else
                engineForce = VARS.maxEngineForce;
        }
        if (VARS.actions.braking) {
            if (speed > 1)
                breakingForce = VARS.maxBreakingForce;
            else
                engineForce = -VARS.maxEngineForce / 2;
        }
        if (VARS.actions.left) {
            if (vehicleSteering < VARS.steeringClamp)
                vehicleSteering += VARS.steeringIncrement;
        }
        else {
            if (VARS.actions.right) {
                if (vehicleSteering > -VARS.steeringClamp)
                    vehicleSteering -= VARS.steeringIncrement;
            }
            else {
                if (vehicleSteering < -VARS.steeringIncrement)
                    vehicleSteering += VARS.steeringIncrement;
                else {
                    if (vehicleSteering > VARS.steeringIncrement)
                        vehicleSteering -= VARS.steeringIncrement;
                    else {
                        vehicleSteering = 0;
                    }
                }
            }
        }

        vehicle.applyEngineForce(engineForce, BACK_LEFT);
        vehicle.applyEngineForce(engineForce, BACK_RIGHT);

        vehicle.setBrake(breakingForce / 2, FRONT_LEFT);
        vehicle.setBrake(breakingForce / 2, FRONT_RIGHT);
        vehicle.setBrake(breakingForce, BACK_LEFT);
        vehicle.setBrake(breakingForce, BACK_RIGHT);

        vehicle.setSteeringValue(vehicleSteering, FRONT_LEFT);
        vehicle.setSteeringValue(vehicleSteering, FRONT_RIGHT);


        var tm, p, q, i;
        var n = vehicle.getNumWheels();
        for (i = 0; i < n; i++) {
            vehicle.updateWheelTransform(i, true);
            tm = vehicle.getWheelTransformWS(i);
            p = tm.getOrigin();
            q = tm.getRotation();
            wheelMeshes[i].position.set(p.x(), p.y(), p.z());
            wheelMeshes[i].quaternion.set(q.x(), q.y(), q.z(), q.w());
            wheelMeshes[i].scale.x = -1;
        }

    }

    VARS.syncVehicleCallback = sync;
}

createVehicle(new v3d.Vector3(0, 1, 0), ZERO_QUATERNION);
